import React, { useContext } from "react";
import { counterContext } from "../../Context/CounterContext";

function Home(props) {
  let { increaseCounter } = useContext(counterContext);
  return (
    <div>
      Home
      <button
        className="btn btn-success"
        onClick={() => {
            increaseCounter();
        }}
      >
        Increase
      </button>
    </div>
  );
}

export default Home;
